import React from 'react';

//import { SearchBox } from 'office-ui-fabric-react/lib/SearchBox';
import logo from "../../img/menu.jpg";

import './Navbar.css';

function Navbar() {
  return (

    <div class="Navbar">

      <div class="Navbar__Menu">â˜°</div>

      <nav class="Navbar__Items">
        <div class="Navbar__Link">Longer Link</div>
        <div class="Navbar__Link">Longer Link</div>
        <div class="Navbar__Link">Link</div>
      </nav>

      <nav class="Navbar__Items Navbar__Items--right">
        <div class="Navbar__Link">Link</div>
        <div class="Navbar__Link">Link</div>
      </nav>

      <div className="Navbar__Link Navbar__Link-toggle">
        <img className="logo" src={logo} alt="Face" />
      </div>

    </div>

  );
}

export default Navbar;
